// src/Pages/NotFound.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './NotFound.css';

const NotFound = () => {
  return (
    <div className='not-found' data-aos="fade-up">
      <h1 data-aos="zoom-in">404</h1>
      <p data-aos="fade-up" data-aos-delay="200">Oops! The page you're looking for does not exist.</p>
      <Link to="/" data-aos="fade-up" data-aos-delay="400">Go Back to Home</Link>
    </div>
  );
};

export default NotFound;
